import React, { useState } from 'react';
import { useParams } from 'react-router';

// app
import { LossClaimsTasksDashboardView } from './LossClaimsTasksDashboard.view';
import * as utils from 'utils';

export default function LossClaimsTasksDashboard(){
    const params = useParams();
    const [selectedTab, setSelectedTab] = useState(params?.tab || 'lossesTab');
    
    const tabs = [
        { value: 'lossesTab', label: utils.string.t('claims.lossClaimsTasksDashboard.losses') },
        { value: 'claimsTab', label: utils.string.t('claims.lossClaimsTasksDashboard.claims') },
        { value: 'tasksTab', label: utils.string.t('claims.lossClaimsTasksDashboard.tasks') },
        { value: 'reportsTab', label: utils.string.t('claims.lossClaimsTasksDashboard.reports') },
        { value: 'advanceSearchTab', label: utils.string.t('claims.lossClaimsTasksDashboard.advanceSearch') },
    ];

    const handleSelectTab = (tabName) => {
        setSelectedTab(tabName);
    };

    return (
        <LossClaimsTasksDashboardView
            tabs={tabs}
            selectedTab={selectedTab}
            handleSelectTab={handleSelectTab}
        />
    )

};
